// StateList.js

import React, { useState } from 'react';

const StateList = () => {
  const [stateList] = useState([
    {
      _id: 1,
      name: 'Andhra Pradesh',
      details: {
        culture: 'Rich cultural heritage...',
        dress: 'Traditional attire...',
        food: 'Delicious local cuisine...',
        festivals: 'Celebration of various festivals...',
        temples: 'Famous temples...',
      },
    },
    {
      _id: 2,
      name: 'Maharashtra',
      details: {
        culture: 'Diverse cultural influences...',
        dress: 'Variety of traditional clothing...',
        food: 'Delectable Maharashtrian cuisine...',
        festivals: 'Vibrant festival celebrations...',
        temples: 'Historical temples...',
      },
    },
    // Add details for other states...
  ]);

  const handleStateClick = (stateDetails) => {
    // Implement the logic to display detailed information about the clicked state
    alert(
      `Details about ${stateDetails.culture}, ${stateDetails.dress}, ${stateDetails.food}, ${stateDetails.festivals}, ${stateDetails.temples}`
    );
    // You can update the state or use a modal to display detailed information
  };

  return (
    <div>
      <h2>State List</h2>
      <ul>
        {stateList.map((state) => (
          <li key={state._id}>
            {state.name} -{' '}
            <button onClick={() => handleStateClick(state.details)}>Click Here</button>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default StateList;
